import React, { Component } from 'react';
import { Stack, ButtonGroup, Container, TableContainer, 
        Table, TableHead, TableRow, TableCell, TableBody, 
        IconButton, Dialog, DialogTitle, DialogContentText,
        DialogContent, DialogActions, Button } from '@mui/material';
import ModeEditIcon from '@mui/icons-material/ModeEdit';
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';
import PersonAddAlt1Icon from '@mui/icons-material/PersonAddAlt1';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';

class VehicleList extends Component {

    constructor(props) {
        super(props);
        this.state = {
                vehicles: [],
                deleteDialogOpen: false,
                vehicleToDelete: null
            };
        this.remove = this.remove.bind(this);
        this.handleDialogClose = this.handleDialogClose.bind(this);
        this.handleDelete = this.handleDelete.bind(this);
    }

    componentDidMount() {
        fetch('/vehicles')
            .then(response => response.json())
            .then(data => this.setState({vehicles: data}));
    }

    async remove(id) {
        await fetch(`/vehicles/${id}`, {
            method: 'DELETE',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            }
        }).then(() => {
            let updatedVehicles = [...this.state.vehicles].filter(i => i.vehicleId !== id);
            this.setState({vehicles: updatedVehicles});
        });
    }

    handleDialogClose(choice) {
        if(choice === 'DELETE'){
            this.remove(this.state.vehicleToDelete.id)
        }
        this.setState({
            deleteDialogOpen: false
        });   
    }

    handleDelete(vehicleId) {
        this.setState({
            vehicleToDelete: vehicleId,
            deleteDialogOpen: true
        })
        console.log(this.state);
    }
    
    render() {
        const {vehicles, isLoading} = this.state;
    
        if (isLoading) {
            return <p>Loading...</p>;
        }
    
        const vehicleList = vehicles.map(vehicle => {
            return (
                <TableRow key={vehicle.vehicleId}>
                    <TableCell style={{whiteSpace: 'nowrap'}}>{vehicle.vehicleId}</TableCell>
                    <TableCell>{vehicle.year}</TableCell>
                    <TableCell>{vehicle.make}</TableCell>
                    <TableCell>{vehicle.model}</TableCell>
                    <TableCell>{vehicle.notes}</TableCell>
                    <TableCell>
                        <ButtonGroup>
                            <IconButton color="success" component={Link} to={"/vehicles/" + vehicle.vehicleId}>
                                <ModeEditIcon/>
                            </IconButton>
                            <IconButton color="error" onClick={() => this.handleDelete(vehicle)}>
                                <DeleteForeverIcon/>
                            </IconButton>
                        </ButtonGroup>
                    </TableCell>
                </TableRow>
            )
        });
    
        return (
            <div>
                <AppNavbar/>
                <Container fluid>
                    <Stack direction="row">
                        <h3>Vehicles</h3>
                        <IconButton color="success" component={Link} to="/vehicles/new">
                            <PersonAddAlt1Icon/>
                        </IconButton>
                    </Stack>
                    <TableContainer>
                        <Table className="mt-4">
                            <TableHead>
                            <TableRow>
                                <TableCell width="10%">Vehicle ID</TableCell>
                                <TableCell width="30%">Description</TableCell>
                                <TableCell width="10%">Year</TableCell>
                                <TableCell width="10%">Make</TableCell>
                                <TableCell width="20%">Model</TableCell>
                                <TableCell width="20%">Notes</TableCell>
                            </TableRow>
                            </TableHead>
                            <TableBody>
                                {vehicleList}
                            </TableBody>
                        </Table>
                    </TableContainer>
                </Container>
                <Dialog
                    open={this.state.deleteDialogOpen}
                    aria-labelledby="alert-dialog-title"
                    aria-describedby="alert-dialog-description"
                >
                    <DialogTitle id="alert-dialog-title">
                    {"Are you sure you want to delete this vehicle?"}
                    </DialogTitle>
                    <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        {this.state.deleteDialogOpen ? JSON.stringify(this.state.vehicleToDelete) : ''}
                    </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                    <Button onClick={() => this.handleDialogClose('CANCEL')}>Cancel</Button>
                    <Button onClick={() => this.handleDialogClose('DELETE')} autoFocus>
                        Delete
                    </Button>
                    </DialogActions>
                </Dialog>
            </div>
        );
    }
}
export default VehicleList;
